import React from 'react'
import './statics/Block.scss'

function BarRegression ({ value }) {
  return <div className="BarRegression"></div>
}

function Block ({ title, value }) {
  return (
    <div className='Block'>
      <p>{ title }</p>
      <BarRegression {...{ value }} />
    </div>
  )
}

export default Block
